import React from 'react';
import 'react-calendar/dist/Calendar.css';



class Header extends React.Component{
  render(){
    return (<header className='header'>{this.props.titel}
    <Button/>
    <Button text="work"/>
    </header>)
  }
}


class App extends React.Component{

    render() {
        return (
        <div>
        <Header titel = "my text"/>
        </div>)
    }

}


export default App
